description:
A tentative look, a flirtatious glance, the gentle touch before a kiss, the 'dance' around one anotherbefore that first memorable embrace-the art of seduction.Sitting together but initially as if apart, his hand moves to her shoulder, gentle yet firm, the approachleads on from a gentle touch to a kiss with anticipation.Beautifully captured in five passionate and sexually charged scenes. This film is a journey that will drawyou in and immerse you in a plethora of colour, sound and emotion, engaging you completely.

